const Request = () => {
    return (
        <div id="request">
            <div className="container">
                <h1 className="request-h1">Заявка на обмен</h1>
                <div>
                    <form>
                        <div className="request-form">
                            <input type="text"/>
                            <input type="text"/>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Request;
